(function(){var e=io.connect("/");e.on("connect",function(e){console.log("connect",e);$("body").cls("connected")});e.on("disconnect",function(e){console.log("disconnect");$("body").cls({connected:null})});e.on("saveAllData",function(e){$.storage("allData",e)});$("#menu button").tap(function(){var t=$(this);t.data("name")==="select"?e.emit("select"):t.data("name")==="currect"?e.emit("currectUser"):e.emit("changePage",{name:t.data("name"),option:t.data("option")})})})();